import {useCallback} from 'react';
import {Alert, Box, styled} from '@mui/material';
import {useRouter} from 'next/router';
import MyButton from '../../MyButton';
import {StyledButton, Subtitle1, TitleH6} from '../../MyTypography';

type Props = {
  isLogged: boolean;
  showPayment: boolean;
  currentAds: AdsFormValues;
};

const ads = {
  title:
    'Titolo annuncio Titolo annuncio Titolo annuncio Titolo annuncio Titolo annuncio Titolo annuncio Titolo annuncio Titolo annuncioTitolo annuncioTitolo annuncio',
  content:
    "Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book.",
  category: 'categoria-1',
  age: '23',
  city: 'roma',
  neighborhoods: 'Tor sapienza',
  areas: ['la rustica', 'centocelle'],
  email: 'lorenzofaenzi@email.com',
  phone: '234564321',
  whatsapp: true,
  privacyConsens: true,
  specialData: true,
  cover: [
    {
      name: 'banner-pilot.jpeg',
      base64:
        'data:image/jpeg;base64,',
    },
  ],
  imageConsens: true,
};

const ConfirmStep = ({isLogged, showPayment, currentAds}: Props) => {
  const router = useRouter();

  const handleConnection = useCallback(
    (value: 'login' | 'register') => {
      localStorage.setItem('ads-to-confirm', JSON.stringify(currentAds));
      router.push({
        pathname: '/auth',
        query: {tab: value},
      });
    },
    [router, currentAds]
  );

  return (
    <Wrap>
      <TitleH6 marginBottom="20px">Riepilogo annuncio</TitleH6>
      {!isLogged &&
        (showPayment ? (
          <Overlay>
            <Box>
              <TitleH6 marginBottom="20px">Collega un account</TitleH6>
              <Subtitle1 marginBottom="20px">
                Hai selezionato opzioni di visibilità per cui è necessario
                collegare un account all'annuncio prima della creazione
              </Subtitle1>
              <MyButton
                onClick={() => handleConnection('login')}
                variant="contained"
                sx={{marginRight: '20px'}}
              >
                Accedi
              </MyButton>
              <MyButton
                onClick={() => handleConnection('register')}
                color="warning"
              >
                Crea account
              </MyButton>
            </Box>
          </Overlay>
        ) : (
          <Alert severity="warning" sx={{marginBottom: '25px'}}>
            Stai creando un annuncio anonimo che sarà visibile solo per 7
            giorni.
            <br />
            <StyledButton onClick={() => handleConnection('login')}>
              Accedi
            </StyledButton>{' '}
            o{' '}
            <StyledButton onClick={() => handleConnection('register')}>
              registrati
            </StyledButton>{' '}
            per renderlo permanente!
          </Alert>
        ))}
      <AdsCard>
        <img src={ads.cover[0].base64} alt="cover" />
        <Box display="flex" height="100%" flex={1}>
          <AdsTitle>{ads.title.slice(0, 100)}...</AdsTitle>
        </Box>
      </AdsCard>
    </Wrap>
  );
};

export default ConfirmStep;

const Wrap = styled(Box)(() => ({
  display: 'flex',
  flexDirection: 'column',
  marginBottom: '30px',
  position: 'relative',
  flex: 1,
}));

const Overlay = styled(Box)(({theme}) => ({
  position: 'absolute',
  top: 0,
  left: 0,
  width: '100%',
  height: '100%',
  display: 'flex',
  flexDirection: 'column',
  justifyContent: 'center',
  alignItems: 'center',
  background: 'rgba(255, 255, 255, 1)',
  textAlign: 'center',
  padding: '0 100px',

  [theme.breakpoints.down('md')]: {
    padding: '0 50px',
  },

  [theme.breakpoints.down('md')]: {
    padding: '0 20px',
  },
}));

const AdsCard = styled(Box)(({theme}) => ({
  padding: '15px',
  borderRadius: '20px',
  width: '100%',
  background: '#F8FAFB',
  display: 'flex',

  '& + &': {
    marginTop: '20px',
  },

  img: {
    width: '250px',
    height: '150px',
    borderRadius: '15px',
    marginRight: '25px',
  },
}));

const AdsTitle = styled(TitleH6)(({theme}) => ({
  fontWeight: '500',
  fontSize: '20px',

  [theme.breakpoints.down('md')]: {
    fontSize: '18px',
  },
}));
